nteressante no contexto.','Não possuimos essas definições. Pode sugerir, por favor, de acordo com que você acreditar que fique mais interessante no contexto.',52),(50,'Médio Alto','','O valor de venda os 2 apartamentos frente mar, estão avaliados em 3.5mi em média. O fundos em torno de 2.4mi.','Não','','Nao. Seguir conforme o dwg.','Incolor.','Cinza claro (quase o tom da tinta da parede externa).','Branco Itaúnas.','Concreto Estampado Cinza + Piso Tátil.',53),(51,'Médio Alto','','Os apartamentos giram na média de 2.3/2.5mi os TIPOS.','Na cidade de PVA não.','','Não, na planta humanizada tentamos manter um layout pré-estabelecido de acordo com o que o cliente irá comprar, para evitar possíveis problemas. Pois, ja tivemos casos em que mudou a humanizada (a pedido do comercial), e o cliente exigiu que fosse igual na hora do executivo.','Incolor.','Champagne.','Branco Itaúnas.','Concreto Estampado Cinza + Piso Tátil.',54),(52,'Alto padrão. Altíssimo padrão se comparado com a proposta dos demais nas localidades próximas.','O público alvo é misto. Para o consumidor final que pensa em morar, o empreendimento une a comodidade de estar na principal avenida de Porto Belo e ao mesmo tempo imerso em meio a natureza com vista permanente para o mar.','R$ 1.800.000 – R$ 2.200.000','Temos empreendimentos prontos em faixas de valores próximas, porém esse empreendimento se difere dos padrões aplicados nesses já prontos.','A escolha dos mobiliários também será feita pelo escritório da Vanessa Larré.','É sempre legal ficar o mais próximo possível, pelo menos das partes que mostraremos nas imagens.','Transparente incolor.','Café/ marrom escuro no mesmo tom do skp - referência Projetual Pro 1236 aço corten oxidado.','Será uma pedra cinza tipo silestone kensho (aprimorarmos a especificação mais pra frente no detalhamento.','Calçadas privadas (boulevard) será em um produto similar ao fulget e calçada pública no cimento queimado cinza claro.',55),(65,'','','','','','','','','','',28),(66,'','','','','','','','','','',27),(67,'','','','','','','','','','',46),(68,'Alto padrão.','O foco e o investidor imobiliário. Perfil econômico: Alto poder aquisitivo, com recursos disponíveis para investimentos expressivos. Faixa etária: 35 a 60 anos. *Mais detalhes no servidor.','A partir de R$1.3MM a R$2.3MM.','Não temos, este é o nosso primeiro multifamiliar.','Nao.','Sim. Compatibilizar com interiores recebidos e cadernos, e entregar junto com primeira entrega. Se houver revisões nas imagens, ajustar as plantas no final.','Incolor.','Preto Fosco.','Branco Itaúnas.','Paver.',58),(69,'Alto Padrão','','','Nesse padrão, na praia brava, não.','Mobiliário gostaria de trabalhar em equipe.','Sim.','','','','',56),(70,'','','','','','','','','','',57);
