/*!50003 CREATE*/ /*!50017 DEFINER=`improov`@`10.%`*/ /*!50003 TRIGGER `after_update_funcao_imagem` AFTER UPDATE ON `funcao_imagem` FOR EACH ROW BEGIN
    -- Verifica se o status mudou para 'em aprovação'
    IF NEW.status = 'Em aprovação' AND OLD.status <> 'Em aprovação' THEN
        INSERT INTO historico_aprovacoes (
            funcao_imagem_id,
            status_anterior,
            status_novo,
            colaborador_id,
            responsavel
            
        )
        VALUES (
            NEW.idfuncao_imagem,       -- ID da função da imagem
            OLD.status,                -- Status anterior
            NEW.status,                -- Novo status
            NEW.colaborador_id,
            1-- ID do colaborador (se aplicável)
        );
    END IF;
END */;;
