/*!50003 CREATE*/ /*!50017 DEFINER=`improov`@`10.%`*/ /*!50003 TRIGGER metas_funcoes_colab
AFTER UPDATE ON funcao_imagem
FOR EACH ROW
BEGIN
    DECLARE total_finalizados INT;

    -- Verifica se o status foi atualizado para 'Finalizado'
    IF NEW.status = 'Finalizado' THEN
        
        -- Conta quantas imagens do mesmo colaborador e função já foram finalizadas
        SELECT COUNT(*)
        INTO total_finalizados
        FROM funcao_imagem
        WHERE colaborador_id = NEW.colaborador_id
          AND funcao_id = NEW.funcao_id
          AND status = 'Finalizado';

        -- Se o total for um múltiplo de 100, insere na tabela metas_registradas
        IF total_finalizados % 100 = 0 THEN
            INSERT INTO metas_registradas (colaborador_id, funcao_id, total, data_registro)
            VALUES (NEW.colaborador_id, NEW.funcao_id, total_finalizados, NOW());
        END IF;
    END IF;
END */;;
DELIMITER ;
