ve. E ajustaria as da sala alinhadas na mesma direção;</p><p>- Talvez reposicionaria um quadro ali para trás do sofá;</p><p>- Na área do play, estranho aquele pilar desalinhado ali né? E a área é descoberta? Teríamos que tirar o tapete ali, e a mesinha. Os puffs colocaria o mesmo modelo que a mari utilizou no espaço lounge+redário, redondos, com mais carinha de área externa</p>',1),(70,9474,'Em andamento','Em aprovação','2025-02-11 08:27:13',10,NULL,1),(72,30430,'Não iniciado','Em aprovação','2025-02-11 14:27:48',14,NULL,1),(73,47223,'Em andamento','Em aprovação','2025-02-11 15:36:37',19,NULL,1),(74,47230,'Em andamento','Em aprovação','2025-02-11 15:36:37',19,NULL,1),(75,47223,'Em andamento','Em aprovação','2025-02-11 15:55:12',19,NULL,1),(76,47230,'Em andamento','Em aprovação','2025-02-11 15:55:12',19,NULL,1),(77,9747,'Não iniciado','Em aprovação','2025-02-11 15:55:32',14,NULL,1),(78,47231,'Não iniciado','Em aprovação','2025-02-11 15:55:45',19,'<p>feedback:</p><p><br></p><p>• Única coisa que ajustaria pensando no imagem que imagem que eles irão fazer, é inverter jantar e estar, para não bloquear tanto a vista da câmera;</p><p>• No meu ver, tiraria o aparador da sacada e colocaria vasos mesmo talvez;</p><p>• E acho que ficou faltando ajustar os números das fotos das refs. com base no layout.</p>',1),(79,47238,'Não iniciado','Em aprovação','2025-02-11 15:55:45',19,NULL,1),(80,9755,'Não iniciado','Em aprovação','2025-02-11 16:22:53',14,NULL,1),(81,9779,'Não iniciado','Em aprovação','2025-02-11 17:14:29',14,NULL,1),(82,9440,'Em andamento','Em aprovação','2025-02-11 17:41:50',10,'<p>feedback:&nbsp;</p><p><br></p><p>- Eu optaria por mesas com tampo de madeira mesmo;</p><p>- Dependendo a escolha do ângulo, talvez daria para omitir um pilar?</p><p>- Não curti muito o painel da sala.. Talvez uma prateleira embaixo também para igualar mais o espaço como um todo, para preencher mais;</p><p>- Os trilhos de luz, penso que poderiam ser no outro sentido, cobrindo todas as mesas, + duas duplas de iluminação na sala. Ou pelo menos estender esses trilhos até a sala..</p><p>- Talvez quadros na parede lisa ao lado das mesas (só caso apareça ela mesmo)</p>',1),(83,9442,'Em andamento','Em aprovação','2025-02-11 17:41:50',10,NULL,1),(84,35376,'Em andamento','Em aprovação','2025-02-11 20:22:37',4,'<p>oi mari! feedback:</p><p><br></p><p>- Faltou mais uma planta nos canteiros;</p><p>- As arandelas brancas e baixas, ficaram escondidas atrás do brinquedo de madeira. Só reposicionar elas para aparecer mesmo;</p><p>- O espaçamento entre os revestimentos do piso, parece um pouquinho maior no 3d;</p><p>- Ajustar cor dos canteiros e aumentar um pouco a escala da arte dos muros;</p><p>- Verificar se não faltou soleira nas portas de correr.</p>',1),(85,35360,'Em andamento','Em aprovação','2025-02-12 00:02:04',4,'<p>feedback:</p><p><br></p><ul><li>Paisagismo, canteiros e móveis diferentes.</li><li>Vamos dar só um confere no arquivo para garantir haha</li></ul>',1),(86,35352,'Em andamento','Em aprovação','2025-02-12 00:02:25',4,'',1),(88,35352,'Em andamento','Em aprovação','2025-02-12 10:59:29',4,'<p>LIN_SUR Piscina</p><p><br></p><p>- Cor da espreguiçadeira</p><p>- Puffs atrás da piscina com o guarda sol no local do arquivo 3d;</p><p>- Mesinhas entre os puffs;</p><p>- Faltaram vasos com plantas;</p><p>- Revestimentos piso e piscina;</p><p>- Falta duchas e brise madeira que bloqueia as duchas;</p><p>- Vasos entre piscinas;</p><p>- Brises de madeira com tamanho das ripas diferentes, conforme projeto;</p><p>- Plantas mais semelhantes.</p>',1),(89,47239,'Em andamento','Em aprovação','2025-02-12 11:23:28',19,'<p>feedback:</p><p><br></p><p>• Colocaria led no cortineiro que faltou ali também</p><p>• Diminuiria o comprimento do armário, pq ali naquele trecho fica tipo 65cm de passagem;</p><p>• Não faria a bancada na frente da vista, para valorizar mais a vista;</p><p>• Então talvez deixaria ela de canto mesmo, sem gaveteiro, mais leve.</p>',1),(90,47246,'Em andamento','Em aprovação','2025-02-12 11:23:28',19,NULL,1),(92,9779,'Em aprovação','Aprovado','2025-02-12 15:54:18',14,NULL,21),(97,9763,'Não iniciado','Em aprovação','2025-02-12 16:01:59',14,NULL,1),(98,9779,'Aprovado','Em aprovação','2025-02-12 16:02:11',14,'',1),(99,9779,'Em aprovação','Aprovado','2025-02-12 16:04:11',14,NULL,21),(100,9779,'Aprovado','Em aprovação','2025-02-12 16:10:46',14,NULL,1),(101,9779,'Em aprovação','Aprovado','2025-02-12 16:11:00',14,NULL,21),(102,9779,'Aprovado','Em aprovação','2025-02-12 16:14:27',14,NULL,1),(103,9779,'Em aprovação','Aprovado','2025-02-12 16:14:37',14,NULL,21),(104,9779,'Aprovado','Em aprovação','2025-02-12 16:22:59',14,NULL,1),(105,9779,'Em aprovação','Ajuste','2025-02-12 16:23:08',14,NULL,21),(106,9779,'Em andamento','Em aprovação','2025-02-12 16:23:47',14,NULL,1),(107,9779,'Em aprovação','Ajuste','2025-02-12 16:41:17',14,NULL,21),(108,9779,'Ajuste','Em aprovação','2025-02-12 16:41:33',14,NULL,1),(109,35403,'Não iniciado','Em aprovação','2025-02-12 17:37:52',14,NULL,1),(110,9827,'Não iniciado','Em aprovação','2025-02-12 18:07:04',14,NULL,1),(111,35376,'Em andamento','Em aprovação','2025-02-12 21:04:05',4,'<p>feedback:</p><p><br></p><p>• Faltou mais uma planta nos canteiros;</p><p>• Reposicionar um pouquinho mais as arandelas baixas e brancas, para as duas ficarem aparentes.</p>',1),(112,9560,'Em andamento','Em aprovação','2025-02-12 21:43:07',4,NULL,1),(113,9568,'Em andamento','Em aprovação','2025-02-12 22:48:33',4,NULL,1),(114,9760,'Em andamento','Em aprovação','2025-02-13 09:08:07',6,'<p>feedback:</p><p><br></p><p>- Deixaria o laranja menos saturado, tom mais fechado;</p><p>- A coifa seria legal afastada da bancada uns 80cm, talvez já esteja;</p><p>- Os pendentes afastados uns 80cm da mesa, só para confirmar mesmo;</p><p>- Achei um pouco que a coifa pesou em preto, na cozinha branca. O que achas?</p><p>- De restante, só eliminaria alguns spots em cima das poltronas, colocando só duas duplas talvez (também no meu gosto pessoal, curto mais o modelo retinho haha). E os perfis achei pequenos, talvez deixar mais comprido.</p>',1),(115,9784,'Finalizado','Em aprovação','2025-02-13 09:08:23',6,'<p>Feedback (:</p><p><br></p><p>- Eu acho que muitas coisas não valorizaram, e o mood da construtora não tem tantas cores, então faria as seguintes sugestões:</p><p>- Eu pessoalmente não gostei das mesas de vidro, colocaria mesas normais amadeiradas;</p><p>- Ajustaria o tom da madeira no tom do mood;</p><p>- Deixaria a parede com cor em um tom bem mais fechado, menos saturado;</p><p>- Substituiria a montagem de cores na parede, por espelhos orgânicos. O modelo que está na parede laranja, porém maior e mais robusto, talvez outro bloco. Podemos manter o letreiro em conjunto com ele;</p><p>- Deixaria o estofado mais robusto, mais grosso, aparecendo menos a base. O encosto também;</p><p>- Talvez utilizaria algumas luminárias articuláveis na parede laranja para iluminar as mesas dos bancos. Ou as luminárias redondas que ela indicou. Faltaram cadeiras nessas mesas também, acredito que não coube, né?</p><p>- Talvez um quadrão no pilar;</p><p>- O mesmo mármore na cozinha, ilha, base ilha.. (talvez já esteja)</p><p>- Lá fora, achei as cadeiras acapulco muito baixas para a mesa.. Utilizaria outro modelo, e se manter a mesa, removeria aquele acabamento em metal no tampo dela. O que você acha?</p>',1),(116,9784,'Em aprovação','Ajuste','2025-02-13 09:13:39',6,NULL,1),(117,9760,'Em aprovação','Ajuste','2025-02-13 09:30:51',6,NULL,1),(118,9568,'Em aprovação','Aprovado','2025-02-13 10:02:00',4,NULL,1),(119,9560,'Em aprovação','Aprovado','2025-02-13 10:04:31',4,NULL,1),(120,35376,'Em aprovação','Ajuste','2025-02-13 13:19:24',4,NULL,1),(121,35419,'Não iniciado','Em aprovação','2025-02-13 13:37:24',14,'',1),(122,47191,'Em aprovação','Aprovado','2025-02-13 14:10:51',19,NULL,1),(123,35352,'Em aprovação','Ajuste','2025-02-13 14:34:07',4,NULL,1),(124,35360,'Em aprovação','Ajuste','2025-02-13 14:40:31',4,NULL,1),(125,35448,'Em andamento','Em aprovação','2025-02-13 17:16:21',10,NULL,1),(126,9576,'Em andamento','Em aprovação','2025-02-13 18:04:29',4,'<p>feedback:</p><p><br></p><p>• Espaço ficou muito pequeno, mas ver para ajustar as proporções;</p><p>• Mesinha de apoio no espaço chess;</p><p>• Talvez diminuir espessura de estofado, para diminuir um pouco altura de deck. Fazer negativo na base de deck também;</p><p>• Fazer deck no canteiro da direita para ter encosto estofado também. Fundo sem encosto estofado, somente assento;</p><p>• Bancos no mesmo piso do chão.</p>',1),(127,47223,'Em andamento','Em aprovação','2025-02-14 12:06:23',19,'<p>feedback:</p><p><br></p><p>• Única coisa que ajustaria pensando no imagem que imagem que eles irão fazer, é inverter jantar e estar, para não bloquear tanto a vista da câmera;</p><p>• No meu ver, tiraria o aparador da sacada e colocaria vasos mesmo talvez;</p><p>• E acho que ficou faltando ajustar os números das fotos das refs. com base no layout.</p>',1),(128,47230,'Em andamento','Em aprovação','2025-02-14 12:06:23',19,NULL,1),(129,9576,'Em aprovação','Ajuste','2025-02-14 14:39:52',4,NULL,1),(130,9440,'Em aprovação','Ajuste','2025-02-14 15:46:24',10,NULL,1),(131,9472,'Em aprovação','Ajuste','2025-02-14 15:47:43',10,NULL,1),(132,47198,'Em aprovação','Aprovado','2025-02-14 16:01:51',19,NULL,1),(133,47214,'Em aprovação','Aprovado','2025-02-14 16:03:07',19,NULL,1),(134,47222,'Em aprovação','Aprovado','2025-02-14 16:05:57',19,NULL,1),(135,47246,'Em aprovação','Aprovado','2025-02-14 16:26:43',19,NULL,1),(136,47239,'Em aprovação','Ajuste','2025-02-14 16:29:24',19,NULL,1),(137,47223,'Em aprovação','Ajuste','2025-02-14 16:53:45',19,NULL,1),(138,47231,'Em aprovação','Ajuste','2025-02-14 16:54:02',19,NULL,1),(139,47230,'Em aprovação','Aprovado','2025-02-14 16:54:28',19,NULL,1),(140,47238,'Em aprovação','Aprovado','2025-02-14 16:54:35',19,NULL,1),(141,48415,'Em andamento','Em aprovação','2025-02-14 17:06:23',19,'<p>feedback:</p><p><br></p><p>• Somente retirar o banco 