aço acho que a cadeira ficou com duas cores.</p>',1),(167,9434,'Em andamento','Em aprovação','2025-02-18 10:06:41',10,NULL,1),(168,38890,'Em andamento','Em aprovação','2025-02-18 10:07:01',10,NULL,1),(169,38898,'Em andamento','Em aprovação','2025-02-18 10:07:04',10,NULL,1),(170,9448,'Em andamento','Em aprovação','2025-02-18 10:07:23',10,'<p>- Já está super funcionando assim! Só listar algumas coisas que tinha pensado no caderno, e tu ve se faz sentido pra ti;</p><p>- Pensei em puffs na mesinha, para fazer link com os mini puffs dos degraus haha ambos na mesma cor. E acho que podemos por os degraus em algum tom para destacar, o que achas?&nbsp;</p><p>- As casinhas que fizesse, talvez faria o painel amadeirado que fizesse em cima, alinhado nelas, para destacar mais o formato delas. Seria uma sugestão mesmo</p>',1),(171,9456,'Em andamento','Em aprovação','2025-02-18 10:07:28',10,'<p>feedback:&nbsp;</p><p><br></p><p>- talvez trabalharia uma cortinha ou persiana!&nbsp;</p><p>- Tinha imaginado esse gesso com mais profundidade também</p><p>- E o painel um pouquinho mais espesso, para ficar mais robusto, o que achas?&nbsp;</p><p>- A bancada deixaria mais fina, para dar para passar a perna ali embaixo</p>',1),(172,9480,'Em andamento','Em aprovação','2025-02-18 10:07:31',10,'<p>- Aqui eu ia sugerir vermos o ângulo para decidir sobre a pintura do piso, para aparecer mais, mas de acordo com o caderno ta certinho, só teria no teto também, no mesmo alinhamento. Acharia legal mostrar mais os puffs também, se for possível, claro;</p><p>- Eu aumentaria mais o tapete orgânico, e a ideia seria ele na mesma cor do piso, terracota;</p><p>- Colocaria cor nos leds, para dar mais cor. Talvez os leds em azul. E os letreiros em laranja? Se quiseres testar o/</p><p>- Talvez uma cor nas mesas de jogos iluminaria a cena também. Trazer um azul mais fechado ou a cor que acharem conivente;</p><p>- Se o ângulo ficar esse, traria o detalhe do led curvo um pouco mais para a esquerda, só para aparecer mais info no teto</p>',1),(173,9488,'Em andamento','Em aprovação','2025-02-18 10:07:36',10,'<p>- Pensei nessa cor mais fechada, para não ficar com cara de laranja;</p><p>- Faria o contorno em mdf ness tom, ao redor do móvel da bancada central do fundo, e a lateral direita da geladeira no mesmo do mdf da churras. O móvel superior da geladeira alinhado ao contorno do móvel lateral, e alinhado ao churras.</p><p>- Faria as bases metálicas da ilha no mesmo tom. Se achas que podes valorizar, inverteria a ilha para trazer os vasos para o lado direito. E usaria plantinhas mais \"cabeludas/pendentes\";</p><p>- As cadeiras e banquetas, eu relmente não sabia que tinha esse acabamento em ferro atrás. Acho que nesse caso podes ver uma opção mais bonita para elas..</p><p>- Deixaria menos saturado o tijolinho interno do churras;</p><p>- A base da mesa, afinaria..&nbsp;</p><p>- Fundo da bancada fundos no mesmo tom, e rodapia e tampos em preto escovado.</p><p>- Talvez uns dois quadrinhos na parede ali;</p>',1),(174,35352,'Em aprovação','Ajuste','2025-02-18 10:08:56',4,NULL,1),(175,35360,'Em aprovação','Aprovado','2025-02-18 10:14:10',4,NULL,1),(176,30462,'Em aprovação','Aprovado','2025-02-18 11:51:15',14,NULL,21),(177,9528,'Em aprovação','Ajuste','2025-02-18 16:27:56',10,NULL,1),(178,9544,'Em aprovação','Ajuste','2025-02-18 16:28:39',10,NULL,1),(179,35352,'Ajuste','Em aprovação','2025-02-18 16:53:51',4,NULL,1),(180,50344,'Em andamento','Em aprovação','2025-02-19 09:17:02',6,'<p>feedback</p><p><br></p><p>- A bancada não pode passar na frente da janela, para não tirar a vista;</p><p>- De resto, ta fiel ao caderno da nic, mas algumas coisas não valorizaram;</p><p>- Esse espelho, achei meio simples.. Podemos por um modelo solto oval, fixo na bancada e no teto talvez. E uma bancada mais leve. O que achas?</p><p>- Se o ângulo for esse mesmo, talvez tiramos o armário de vista, e puxamos a bancada para a parede;</p><p>- O painel curvo na parede da janela, acho que devemos ir até o final, para ficar mais bonito;</p><p>- O piso achei muito clarinho. Pensei que podiamos deixar mais próximo ao tom do painel, para destacar o tapete..</p><p>- Clarearia a cama também, e colocaria uma iluminação indireta atrás.</p>',1),(181,334,'Não iniciado','Em aprovação','2025-02-19 09:39:54',14,NULL,1),(182,35352,'Em aprovação','Aprovado','2025-02-19 10:42:23',4,NULL,1),(183,9563,'Em andamento','Em aprovação','2025-02-19 11:54:18',14,NULL,1),(184,9512,'Em andamento','Em aprovação','2025-02-19 12:25:32',10,'<p>feedback:</p><p><br></p><p>- Realmente muito apertado hahahaa</p><p>- Traria um tom no tapete, pode ser aquele do caderno, o que acha?</p><p>- O ripado eu gosto dele mais slim 2x2cm, mas é uma sugestão mesmo;</p><p>- Penso que o rack poderiamos diferenciar ele do outro apto. Ele mais baixo, até apoiado no chão, e podemos testar ele num tom semelhante ao sofá?</p><p>- Uma iluminação do rack pra cima ficaria legal!</p>',1),(185,9514,'Em andamento','Em aprovação','2025-02-19 12:25:32',10,NULL,1),(186,50344,'Em aprovação','Ajuste','2025-02-19 12:33:20',6,NULL,1),(187,35353,'Em aprovação','Aprovado','2025-02-19 12:34:21',4,NULL,1),(188,37820,'Em aprovação','Aprovado','2025-02-19 13:16:19',7,NULL,1),(189,34300,'Em aprovação','Aprovado','2025-02-19 13:16:32',7,NULL,1),(190,33407,'Em andamento','Em aprovação','2025-02-19 13:53:31',19,'<p>feedback</p><p><br></p><ul><li>ajuste nos assets</li><li>e pequenos ajustes em detalhes do painel</li></ul>',1),(191,33414,'Em andamento','Em aprovação','2025-02-19 13:53:31',19,NULL,1),(192,9571,'Em andamento','Em aprovação','2025-02-19 14:18:46',14,NULL,1),(195,9579,'Não iniciado','Em aprovação','2025-02-19 15:06:08',14,NULL,1),(196,35443,'Em andamento','Em aprovação','2025-02-19 16:47:19',14,NULL,1),(197,9536,'Em andamento','Em aprovação','2025-02-19 19:22:21',10,'<p>feedback:</p><p><br></p><p>- Esse tem uma porta que da acesso ao terraço na parede da direita;</p><p>- É o mesmo teto na sala e na cozinha né? só pra confirmar!</p><p>- Depe