INSERT INTO `observacao_obra` VALUES (5,17,'Uma planta (ex: layout Genésio) utilizamos na planta humanizada tipo.','2025-02-14',1),(6,17,'A outra planta (ex: layout Dani), na planta humanizada da cobertura inferior.','2025-02-14',2),(7,48,'Informações Pendentes: \nLayouts atualizados, projeto 3d de interiores ou inspirações/referências, e confirmação das unidades para desenvolver os apartamentos.','2025-02-18',3),(8,48,'Nas piscinas será usado pastilha tipo pedra natural 10x10cm azul esverdeado (a confirmar com Eliegi) – Já temos essa confirmação? \nR: Podemos seguir com esse revestimento? Sim, mas puxar mais para um tom azul.','2025-02-18',4),(9,48,'Qual seria o material da escada de acesso ao hall, e rampas de acesso às garagens? \nR: Hall - piso Portobello Aeterna Bianco ext (grande formato) .\nR: Degraus - Escada solta com degrau com iluminação inferior.\nR: Rampas acesso garagem - concreto.','2025-02-18',5),(10,48,'Como seria o guarda corpo dos degraus de acesso ao hall? Seguimos conforme o 3d?\nR: Cromado Inox, diferente do 3D que está em vidro.','2025-02-18',6),(11,58,'Arquivo DWG  - 21-02-2025 - CP8_ARQ_AP_R08\n','2025-02-21',7),(12,58,'Arquivos 3D Interiores - Receberemos os projetos em 3d dos ambientes de lazer, ate final do mês de fevereiro. Produziremos cadernos dos apartamentos. Referência no servidor.','2025-02-21',8),(13,58,'Paisagismo - Receberemos material de paisagismo ate metade de março. Plantas deverão ser nativas.','2025-02-21',9),(14,48,'Paisagismo - Poderemos criar, podendo seguir a mesma da linha do Giardini.','2025-02-24',10),(15,52,'Arquivo 3D Fachada (Especificacoes) - Ainda nao foram especificados os materiais da fachada, apenas a referencia estetica. Seguir texturas do arquivo.','2025-02-25',11),(17,55,'Arquivos 3D Interiores - dia 27-02 teremos a entrega de mais um pacote de arquivos. Ainda teremos mais 3 entregas desses pacotes de arquivos. Planilha recebida no servidor.\nApartamentos - Vamos receber os aptos modelados também, pelo cronograma ficou para o próximo pacote de entregas.','2025-02-25',3),(18,55,'Informações Gerais:\n\nQual é o acabamento dos canteiros do embasamento?\nSubiremos com o fulget na superfície dos bancos.\n\nQual é o acabamento das rampas de acesso às garagens?\nConcreto estampado cinza claro.\n\nOs brises do embasamento terão a mesma cor das esquadrias?\nSim.\n\nOs brises da torre serão em que material e cor?\nAmadeirado - referência Projetoal Pro 170414 wood Nogueira.','2025-02-25',5),(19,55,'Arquivo 3D Fachada  - 26-02-2025 - PPB_FACHADA_R02_OP.04 ATUALIZADO','2025-02-25',1),(20,55,'Arquivo DWG - 26-02-2025 - PPB_ARQ_EP_ESTUDO_LAY_TIP_R17','2025-02-25',0),(22,55,'Arquivo 3D Fachada (Especificacoes) - Podemos seguir com a representação próxima do arquivo, mas a área da piscina deve-se aguardar o arquivo da área de lazer externa.','2025-02-25',2),(23,54,'Especificação Fachada: \nCores: Ovelha e Ponte Pencil da Suvinil.\nCorpo do Prédio no tom mais claro e detalhes no tom mais escuro (Referencia no servidor).','2025-02-28',17),(24,55,'Paisagismo - ainda estão definindo alguns pontos com a empresa contratada.','2025-02-25',4);
